import React from "react";

import './styles/categoryStyle.css'

const Category = ({object}) => {
    return(
        <div className='category'>
            <img className='imageCategory' src={object.urlImagen} />
            <div className='textCategory'>
                <h2>{object.titulo}</h2>
                <p>420.069 hoteles</p>
            </div>
        </div>
    );
}

export { Category };
